import React from "react";
import { Avatar } from "antd";

export const ContactsToSelect = () => {
return( 
    <div className="ct-chat-user-item">
        <div className="ct-chat-user-row">
            <div className="ct-chat-avatar">
                <div className="ct-status-pos">
                <Avatar src={"www.google.com.br"} className="ct-size-50" alt="Abbott" />
                </div>
            </div>

            <div className="ct-chat-contact-col">
                <div className="ct-chat-user-name"/>Daniel
                <div className="ct-chat-user-des ct-text-truncate"/>daniel.cassiano@Live.com
            </div>

        </div>
          
    </div>
    );
}
